import React from "react";

export default function FinishScreen({ score }) {
  return (
    <div className="finish-container">
      <p>
        YOU SCORED <span>{score}</span> OUT OF 280 POINTS (
        <span> {Math.trunc((score / 280) * 100)}</span>
        %)
      </p>
    </div>
  );
}
